INSERT INTO `tease_teaser` VALUES (45,'Katy S: Even when the tabby is being cute as can be, Plum is in the background being a clown. In the second pic you can see her writhing around on her back, waving her paws in the air like she just don\'t care.','<div><div>\n<table>\n<tr>\n<td><a href=\"http://friendfeed.com/k8s\" class=\"l_profile\"><img src=\"http://m.friendfeed-media.com/p-1f2df8b6492211dd9c86003048343a40-medium-1008\" alt=\"Katy S\" class=\"picture medium\" /></a></td>\n<td>\n<div>\n\n\n\n<a href=\"http://friendfeed.com/k8s\">Katy S</a> to <a href=\"http://friendfeed.com/k8s\">Katy\'s feed</a>, <a href=\"http://friendfeed.com/kitteh\">Cat Lovers</a>\n\n\n\n\n\n\n</div>\n<div>Even when the tabby is being cute as can be, Plum is in the background being a clown. In the second pic you can see her writhing around on her back, waving her paws in the air like she just don\'t care.</div>\n\n\n<div>\n<table>\n<tr>\n\n\n\n\n\n<td><a href=\"http://m.friendfeed-media.com/d1712e2d6c5d20a3ec3bb0565970170cc2edc387\" rel=\"nofollow\"><img src=\"http://m.friendfeed-media.com/6a940ad3421195421c31431d6bbcb52d67677607\" alt=\"100_7255.jpg\" title=\"100_7255.jpg\" /></a></td>\n\n\n\n<td><a href=\"http://m.friendfeed-media.com/fab4b7927339128a6d14ef6ce9cf4e0981ac03fe\" rel=\"nofollow\"><img src=\"http://m.friendfeed-media.com/7364747c6abe84e34c65ea505260dfb560bc7bc0\" alt=\"100_7256.jpg\" title=\"100_7256.jpg\" /></a></td>\n\n\n</tr>\n</table>\n</div>\n\n\n\n<div>\n<a href=\"http://friendfeed.com/kitteh/03d8340c/even-when-tabby-is-being-cute-as-can-be-plum-in\">20 hours ago</a>\n\n- <a href=\"http://friendfeed.com/kitteh/03d8340c/even-when-tabby-is-being-cute-as-can-be-plum-in\">Comment</a>\n- <a href=\"http://friendfeed.com/kitteh/03d8340c/even-when-tabby-is-being-cute-as-can-be-plum-in\">Like</a>\n</div>\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-smile.png?v=2343\" height=\"16\" width=\"16\" /></td>\n<td><a href=\"http://friendfeed.com/valzone03\">VALD.ZONE NY 4 Team Frank</a>, <a href=\"http://friendfeed.com/soup\">Soup in a TARDIS</a>, <a href=\"http://friendfeed.com/jillbug\">Jillybug</a> and 7 other people liked this</td>\n</tr>\n</table>\n</div>\n\n\n\n\n\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-comment.png?v=1fa9\" height=\"16\" width=\"16\" /></td>\n<td>d\'awwww! You know I adore Plum, but it\'s good to see Sophie in the spotlight, too! :-) - <a href=\"http://friendfeed.com/vicster\">vicster (Team Frank)</a></td>\n</tr>\n</table>\n</div>\n\n\n\n\n<div><a href=\"http://friendfeed.com/kitteh/03d8340c/even-when-tabby-is-being-cute-as-can-be-plum-in\">2 more comments</a></div>\n\n\n\n\n\n\n\n\n\n\n\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-comment.png?v=1fa9\" height=\"16\" width=\"16\" /></td>\n<td>It\'s nice for Sophie to get pictures all to herself... almost. &gt;^.^&lt; - <a href=\"http://friendfeed.com/gravitty\">Heza, Blue Ribbon Baker</a></td>\n</tr>\n</table>\n</div>\n\n\n\n\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-comment.png?v=1fa9\" height=\"16\" width=\"16\" /></td>\n<td>Plum\'s always somewhere close. - <a href=\"http://friendfeed.com/k8s\">Katy S</a></td>\n</tr>\n</table>\n</div>\n\n\n</td>\n</tr>\n</table>\n</div>\n</div>','http://friendfeed.com/kitteh/03d8340c/even-when-tabby-is-being-cute-as-can-be-plum-in',5,7,NULL,75),(22,'Mozart/M.I.A: Requiem for freeborn redheads','<p>\r\n<object width=\"100%\" height=\"81\" data=\"http://player.soundcloud.com/player.swf?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F3806140&amp;secret_url=false\" type=\"application/x-shockwave-flash\">\r\n<param name=\"data\" value=\"http://player.soundcloud.com/player.swf?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F3806140&amp;secret_url=false\" />\r\n<param name=\"src\" value=\"http://player.soundcloud.com/player.swf?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F3806140&amp;secret_url=fals