n\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-comment.png?v=1fa9\" height=\"16\" width=\"16\" /></td>\n<td>good Bunny! - <a href=\"http://friendfeed.com/k8s\">Katy S</a></td>\n</tr>\n</table>\n</div>\n\n\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-comment.png?v=1fa9\" height=\"16\" width=\"16\" /></td>\n<td>I want to eat him up - he\'s so adorable! - <a href=\"http://friendfeed.com/debashmode\">Bash</a></td>\n</tr>\n</table>\n</div>\n\n\n</td>\n</tr>\n</table>\n</div>\n</div>','http://friendfeed.com/kitteh/9e14a292/bunny-is-helping-foxfosterkittens',5,6,NULL,75),(42,'vicster (Team Frank): Cats know our moods. Cats care about our feelings. – Way of Cats blog','<div><div>\n<table>\n<tr>\n<td><a href=\"http://friendfeed.com/vicster\" class=\"l_profile\"><img src=\"http://m.friendfeed-media.com/p-9228b8ea205711ddafde003048343a40-medium-1002\" alt=\"vicster (Team Frank)\" class=\"picture medium\" /></a></td>\n<td>\n<div>\n\n\n\n<a href=\"http://friendfeed.com/vicster\">vicster (Team Frank)</a> to <a href=\"http://friendfeed.com/vicster\">vicster\'s feed</a>, <a href=\"http://friendfeed.com/kitteh\">Cat Lovers</a>\n\n\n\n\n\n\n</div>\n<div>Cats know our moods. Cats care about our feelings. – Way of Cats blog - <a href=\"http://www.wayofcats.com/blog/cat-affection-move-the-paw-of-compassion/7589?utm_source=feedburner&utm_medium=feed&utm_campaign=Feed%3A+wayofcats%2Fbowl+%28The+Way+of+Cats%29\" rel=\"nofollow\" title=\"http://www.wayofcats.com/blog/cat-affection-move-the-paw-of-compassion/7589?utm_source=feedburner&utm_medium=feed&utm_campaign=Feed%3A+wayofcats%2Fbowl+%28The+Way+of+Cats%29\">http://www.wayofcats.com/blog...</a></div>\n\n\n<div>\n<table>\n<tr>\n\n\n\n\n\n<td><a href=\"http://www.wayofcats.com/blog/cat-affection-move-the-paw-of-compassion/7589?utm_source=feedburner&utm_medium=feed&utm_campaign=Feed%3A+wayofcats%2Fbowl+%28The+Way+of+Cats%29\" rel=\"nofollow\"><img src=\"http://m.friendfeed-media.com/9257bbed538c817f3736df842daf00c10078d2fd\" alt=\"Cats know our moods. Cats care about our feelings. – Way of Cats blog\" title=\"Cats know our moods. Cats care about our feelings. – Way of Cats blog\" /></a></td>\n\n\n</tr>\n</table>\n</div>\n\n\n\n<div>\n<a href=\"http://friendfeed.com/kitteh/bd0c69c8/cats-know-our-moods-care-about-feelings-way-of\">Sunday</a>\n\n\n\nfrom <a href=\"http://friendfeed.com/share/bookmarklet\" rel=\"nofollow\">Bookmarklet</a>\n\n\n- <a href=\"http://friendfeed.com/kitteh/bd0c69c8/cats-know-our-moods-care-about-feelings-way-of\">Comment</a>\n- <a href=\"http://friendfeed.com/kitteh/bd0c69c8/cats-know-our-moods-care-about-feelings-way-of\">Like</a>\n</div>\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-smile.png?v=2343\" height=\"16\" width=\"16\" /></td>\n<td><a href=\"http://friendfeed.com/jenn2d2\">Jennifer Dittrich</a>, <a href=\"http://friendfeed.com/joffi\">Michael W. May</a>, <a href=\"http://friendfeed.com/jln\">Jessie</a> and 7 other people liked this</td>\n</tr>\n</table>\n</div>\n\n\n\n\n\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-comment.png?v=1fa9\" height=\"16\" width=\"16\" /></td>\n<td>\"When we have a good cat relationship, our cats will extend the Paw of Compassion.  Sometimes this is literal, as when they lay their paw on our arm or leg. Sometimes it’s a head rubbed across our cheek or forehead, sometimes it’s curling up near us. But our cats do seem moved to comfort us when they know we are down.\" - <a href=\"http://friendfeed.com/vicster\">vicster (Team Frank)</a></td>\n</tr>\n</table>\n</div>\n\n\n\n\n<div><a href=\"http://friendfeed.com/kitteh/bd0c69c8/cats-know-our-moods-care-about-feelings-way-of\">3 more comments</a></div>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-comment.png?v=1fa9\" height=\"16\" width=\"16\" /></td>\n<td>Y\'all have to quit making me want pets I can\'t afford (which is pretty much any pet). - <a href=\"http://friendfeed.com/spidra\">Spidra Webster</a></td>\n</tr>\n</table>\n</div>\n\n\n\n\n\n\n<div>\n<table>\n<tr>\n<td><img src=\"http://friendfeed.com/static/images/n-comment.png?v=1fa9\" height=\"16\" width=\"16\" /></td>\n<td>@Spidra, last year my kitten acquired a urinary blockage. 900.00 for emergency vet, 80 for the three days spent at my vet and now I must feed him expensive prescription food. I have two other cats so now all are on this high end food. It has altered our budget! - <a href=\"http://friendfeed.com/jltrdms\">Janet</a></td>\n</tr>\n</table>\n</div>\n\n\n</td>\n</tr>\n</table>\n</div>\n</div>','http://www.wayofcats.com/blog/cat-affection-move-the-paw-of-compassion/7589?utm_source=feedburner&utm_medium=feed&utm_campaign=Feed%3A+wayofcats%2Fbowl+%28The+Way+of+Cats%29',5,4,NULL,75),(39,'Vicster: Way of Cats blog','<div>\r\n<div><span style=\"font-size: small;\"><span><span style=\"font-size: 10px;\">Take a good look at the period at the end of this sentence. That&rsquo;s about the size of a kitten attention span.</span></span></span></div>\r\n</div>','http://www.wayofcats.com/blog/kittens-and-distractibility/9788?utm_source=feedburner&utm_medium=feed&utm_campaign=Feed%3A+wayofcats%2Fbowl+%28The+Way+of+Cats%29&utm_content=Google+Reader',3,1,'http://m.friendfeed-media.com/9302fe51453baa745a14bcf5a8ec0a8fa7a8dd38',75),(48,'My site','','http://zzzen.com/',7,1,'',75),(49,'Video','','http://youtube.com/nonboong',7,3,'',75),(50,'Music','','http://soundcloud.com/the-dod',7,4,'',75),(51,'Code','','http://thedod.github.com/',7,2,'',75),(52,'The #barcampbkk4 SynPhonia workshop','<p>Feel free to play with it and submit your mixes.</p>\r\n<p>@<a href=\"http://twitter.com/kijjaz\" target=\"_blank\">Kijjaz</a> and @<a href=\"http://twitter.com/TheRealDod\" target=\"_blank\">TheRealDod</a></p>','http://bkk4.swatwt.com/',2,2,'http://i1.soundcloud.com/artworks-000002734682-9m0o9o-crop.jpg?6030a4',75),(40,'Je